    false,nt"url": null,nt"notes": "This dataset was created to show all areas
    where an erosion hazard zone analysis will be required for any proposed development.
     THIS LAYER DOES NOT REPRESENT A CALCULATED EROSION HAZARD ZONE.  It simply indicates
    whether or not an erosion hazard zone analysis is needed per LDC (see below).  nnEffective
    October 28, 2013, the Cityu2019s Land Development Code u00a725-7-32 allows:n nu201c
    The director may require u2026 an analysis to establish the erosion hazard zone
    if the proposed development is within 100 feet of the centerline of a waterway with
    a drainage area of 64 acres or greater; or where significant erosion is present.
